import "./App.scss";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Header from "./components/Header/index";
import HomePage from "./pages/HomePage/index";
import Login from "./pages/Login/index";
import SignUp from "./pages/SignUp";
import NoSensitivity from "./components/NoSensitivity/NoSensitivity";
import YesSensitivity from "./components/YesSensitivity/YesSensitivity";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <Switch>
          <Route path="/" exact component={HomePage} />
          <Route path="/products/:id" exact component={HomePage} />
          <Route
            path="/users/notsensitive/:userID"
            exact
            component={NoSensitivity}
          />
          <Route
            path="/users/sensitive/:userID"
            exact
            component={YesSensitivity}
          />
          <Route path="/login" exact component={Login} />
          <Route path="/signup" exact component={SignUp} />
          {/* <ProtectedRoute to="/" exact component={HomePage} /> */}
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
